import React, {useState, useEffect } from 'react';
import {fetchDate } from '../../api';


const Chart = () =>{
    const [dailyData, setDailyData] = useState({});

    useEffect( ()=>{
        const fetchAPI = async () => {
            const dailyData = await fetchDate();
            setDailyData(dailyData);
        }
        fetchAPI();
    } );
    return (
        <h1>Chart</h1>
    )
}

export default Chart;
